import React from 'react'
import styled from 'styled-components'

export const Navigation = () => {
    const NavigationWrapper = styled.nav`
        position: fixed;
        background: #000;
        color: white;
        padding: 2rem;
    `
  return (
    <NavigationWrapper>
        <ul style={{listStyle: "none", margin: 0}}>
            <li>Profile</li>
            <li>News</li>
            <li>Chats</li>
            <li>Music</li>
            <li>Apps</li>
        </ul>
    </NavigationWrapper>
  )
}
